import {HomeContainer} from "../views/pages/Home";
import {CompositionsContainer} from "../views/pages/Compositions";
import {ShowcaseContainer} from "../views/pages/Showcase";
import {SuggestFormContainer, SuggestFormSucceed} from "../views/pages/SuggestForm";
import {OrderFormContainer, OrderFormSucceed} from "../views/pages/OrderForm";
import {ErrorPage} from "../views/pages/ErrorPage";


const routes = [
    {
        path: '/',
        exact: true,
        auth: false,
        component: HomeContainer
    },
    {
        path: '/suggest',
        exact: true,
        auth: true,
        component: SuggestFormContainer
    },
    {
        path: '/suggest/success',
        exact: true,
        auth: true,
        component: SuggestFormSucceed
    },
    {
        path: '/compositions(/:page)?',
        exact: true,
        auth: true,
        component: CompositionsContainer
    },
    // {
    //     path: '/showcase/:id',
    //     exact: false,
    //     auth: true,
    //     component: ShowcaseContainer
    // },
    {
        path: '/order/:id',
        exact: true,
        auth: true,
        component: OrderFormContainer
    },
    {
        path: '/order/:id/success',
        exact: false,
        auth: true,
        component: OrderFormSucceed
    },
    {
        path: '*',
        exact: true,
        auth: false,
        component: ErrorPage
    }
];

export default routes;
